/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
.welcome {
  display: flex;
  font-size: 1.25em;
  line-height: 1.4;
  color: #a8a8a8;
  background-color: #241b2f;
  overflow-x: auto;
}
.welcome p {
  line-height: inherit;
}
.welcome a {
  color: #6494ed;
}
.welcome ul {
  padding-left: 2em;
}
.welcome label {
  margin-top: 1em;
  font-weight: normal;
}
.welcome .input-checkbox {
  margin-top: -0.2em;
  margin-right: .5em;
}
.welcome-container {
  width: 100%;
  max-width: 580px;
  min-width: 300px;
  margin: auto;
  padding: 3em 2em;
}
.welcome-header {
  margin: 0 0 3em 0;
}
.welcome-logo {
  display: block;
  width: 100%;
  max-width: 280px;
  margin: 0 auto 2em auto;
  color: #f0f0f0;
}
.welcome-title {
  font-size: 1.4em;
  text-align: center;
  line-height: 1.3;
  margin: 1em 0;
}
.welcome-card {
  margin: 1em 0;
  border-radius: 4px;
  border: 1px solid #100c15;
  background-color: #2b2139;
}
.welcome-summary {
  padding: 1em 1.5em;
  font-size: 1.1em;
  font-weight: 300;
  line-height: 1.4;
  cursor: pointer;
}
.welcome-summary:hover {
  color: #b3b3b3;
}
.welcome-summary::-webkit-details-marker {
  display: none;
}
.welcome-summary:before {
  width: 20px;
  color: #808080;
}
details[open] .welcome-summary:before {
  color: #f0f0f0;
}
details[open] .welcome-summary {
  color: #f0f0f0;
}
.welcome-highlight {
  color: #f0f0f0;
}
.welcome-detail {
  border-top: 1px solid #100c15;
  padding: 1.5em;
}
.welcome-detail .welcome-note {
  margin-bottom: 0;
}
.welcome-detail .btn {
  margin-top: 3.33333333px;
  margin-bottom: 3.33333333px;
}
.welcome-img {
  display: block;
  max-width: 100%;
  border-radius: 3px;
  margin: 0 0 1em 0;
  border: 1px solid #100c15;
}
.welcome-consent {
  margin-top: 3em;
}
.welcome-consent-choices {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  margin: 1em -1em;
}
.welcome-consent-choices button {
  width: 100%;
}
.welcome-consent-choices div {
  margin: .5em 1em;
  flex: 1;
}
.welcome-consent-choices .welcome-note {
  margin-top: 1em;
}
.welcome-key {
  display: inline-block;
  padding: .3em .4em;
  font-size: .8em;
  line-height: 1;
  border-radius: 3px;
  color: #f0f0f0;
  border: 1px solid #808080;
  background: rgba(0, 0, 0, 0.1);
}
.welcome-love {
  color: #808080;
}
.welcome-love a {
  color: #808080;
}
.welcome-love .icon::before {
  position: relative;
  top: 4px;
  width: auto;
  margin-right: 0;
  font-size: 1.5em;
}
.welcome-love .icon-logo-github::before {
  top: 2px;
  font-size: 3.6em;
  vertical-align: top;
}
.welcome-note {
  font-size: .86em;
  color: #808080;
}
.welcome-note .icon {
  margin-left: 5px;
}
.welcome-note .icon::before {
  margin-right: 0;
}
.welcome-footer {
  margin-top: 1em;
  text-align: center;
}
